public class ShortestPalindome {



    public static void main(String[] args) {
        String t = "";
        String t1 = "b";
        String t2 = "ba";
        String t3 = "abbacd";
        String t4 = "aacecaaa";
        String t5 = "abcd";
        String t6 = "vccv";
        System.out.println(solution3(t));
        System.out.println(solution3(t1));
        System.out.println(solution3(t2));
        System.out.println(solution3(t3));
        System.out.println(solution3(t4));
        System.out.println(solution3(t5));
        System.out.println(solution3(t6));
    }





    private static String solution3(String s) {

        String rev_s = new StringBuilder(s).reverse().toString();
        // Use special character to avoid overlap
        String l = s + "#" + rev_s;

        int[] p = new int[l.length()];

        // build KMP table.
        // i -> suffix boundary
        // j -> prefix boundary
        for (int i = 1; i < l.length(); i++) {

            // update prefix boundary
            int j = p[i-1];

            // move to the last prefix boundary match
            while (j>0 && l.charAt(i) != l.charAt(j)) {
                j = p[j - 1];
            }
            // if prefix boundary matches suffix boundary, increase prefix length
            if (l.charAt(i) == l.charAt(j)){
                p[i] = j + 1;
            }

        }
        return rev_s.substring(0, s.length() - p[l.length() - 1] )+ s;
    }











    private static String solution2(String s) {


        int left = 0;
        int right = s.length()-1;
        int holder = right;
        while (left < right) {
            if (s.charAt(left) == s.charAt(right)){
                left++;
                right--;
            }else {
                left = 0;
                holder--;
                right = holder;
            }

        }
        if (holder == s.length()-1) return s;
        return new StringBuilder(s.substring(holder + 1)).reverse() + s;
    }









    // works but too slow
    private static String solution(String s) {
        if (checkPalindrome(s)) return s;

        char[] c = s.toCharArray();

        int i = c.length-1;
        while (i>1) {
            if (checkPalindrome(s.substring(0, i))){
                return reverse(s.substring(i)) + s;
            }
            i--;
        }
        return reverse(s.substring(1)) + s;
    }

    private static boolean checkPalindrome(String s){
        if (s.length() < 2) return true;

        int i = 0;
        while (i < s.length()/2){
            if (s.charAt(i) != s.charAt(s.length()-1-i)) return false;
            i++;
        }
        return true;
    }

    private static String reverse(String s){
        String o = "";
        for (int i = 0; i < s.length(); i++) {
            o =  s.charAt(i) + o;
        }

        return o;
    }

}
